const { test, expect } = require('@playwright/test');

test('Fix login click interception', async ({ page }) => {
  // Navigate to the app
  await page.goto('/');

  // Wait for page to load
  await page.waitForTimeout(2000);

  // Fill login form
  await page.fill('input[placeholder="admin"]', 'admin');
  await page.fill('input[type="password"]', 'admin123');

  // Try different click methods to fix interception
  const loginButton = page.locator('button:has-text("Login")');

  // Method 1: Force click to bypass interception
  console.log('Trying force click...');
  try {
    await loginButton.click({ force: true });
    await page.waitForTimeout(3000);
    console.log('✅ Force click worked');
    return;
  } catch (error) {
    console.log('Force click failed:', error.message);
  }

  // Method 2: Scroll and click
  console.log('Trying scroll then click...');
  try {
    await loginButton.scrollIntoViewIfNeeded();
    await page.waitForTimeout(500);
    await loginButton.click();
    await page.waitForTimeout(3000);
    console.log('✅ Scroll and click worked');
    return;
  } catch (error) {
    console.log('Scroll and click failed:', error.message);
  }

  // Method 3: Click coordinates
  console.log('Trying click by coordinates...');
  try {
    const buttonBox = await loginButton.boundingBox();
    if (buttonBox) {
      await page.mouse.click(buttonBox.x + buttonBox.width / 2, buttonBox.y + buttonBox.height / 2);
      await page.waitForTimeout(3000);
      console.log('✅ Coordinate click worked');
      return;
    }
  } catch (error) {
    console.log('Coordinate click failed:', error.message);
  }

  // Method 4: Dispatch click event directly
  console.log('Trying dispatch click...');
  try {
    await loginButton.dispatchEvent('click');
    await page.waitForTimeout(3000);
    console.log('✅ Dispatch click worked');
    return;
  } catch (error) {
    console.log('Dispatch click failed:', error.message);
  }

  console.log('❌ All click methods failed');
});

