const { test, expect } = require('@playwright/test');

test('Fix login click interception', async ({ page }) => {
  // Navigate to the app
  await page.goto('/');

  // Wait for page to load
  await page.waitForTimeout(2000);

  // Fill login form
  await page.fill('input[placeholder="admin"]', 'admin');
  await page.fill('input[type="password"]', 'admin123');

  // Try different click methods to fix interception
  const loginButton = page.locator('button:has-text("Login")');

  // Method 1: Force click to bypass interception
  console.log('Trying force click...');
  try {
    await loginButton.click({ force: true });
    await page.waitForTimeout(3000);

    // Check if login succeeded
    const currentUrl = page.url();
    if (currentUrl.includes('dashboard') || currentUrl !== page.url()) {
      console.log('✅ Force click worked - login succeeded');
      expect(true).toBe(true);
      return;
    }
  } catch (error) {
    console.log('Force click failed:', error.message);
  }

  // Method 2: Use keyboard Enter key
  console.log('Trying Enter key...');
  try {
    await page.press('input[type="password"]', 'Enter');
    await page.waitForTimeout(3000);

    // Check if login succeeded
    const currentUrl = page.url();
    if (currentUrl.includes('dashboard')) {
      console.log('✅ Enter key worked - login succeeded');
      expect(true).toBe(true);
      return;
    }
  } catch (error) {
    console.log('Enter key failed:', error.message);
  }

  // Method 3: Submit form directly
  console.log('Trying form submit...');
  try {
    const form = page.locator('form').first();
    await form.evaluate(form => form.requestSubmit());
    await page.waitForTimeout(3000);

    // Check if login succeeded
    const currentUrl = page.url();
    if (currentUrl.includes('dashboard')) {
      console.log('✅ Form submit worked - login succeeded');
      expect(true).toBe(true);
      return;
    }
  } catch (error) {
    console.log('Form submit failed:', error.message);
  }

  console.log('❌ All login methods failed');
  expect(false).toBe(true); // Fail test if nothing worked
});

