  test('should have consistent navigation menu across pages', async ({ page }) => {
    const pages = ['/dashboard', '/production', '/customers', '/parts'];

    for (const pagePath of pages) {
      await page.goto(pagePath);
      await page.waitForTimeout(1000);

      // Check for navigation elements
      const navElements = await page.locator('nav, [role="navigation"], .MuiAppBar-root').count();
      const navLinks = await page.locator('a, button').filter({ hasText: /Dashboard|Production|Customer|Parts/i }).count();

      console.log(`🧭 ${pagePath}: Nav elements=${navElements}, Nav links=${navLinks}`);

      expect(navElements).toBeGreaterThan(0);
      expect(navLinks).toBeGreaterThan(2);
    }

    console.log('✅ Consistent navigation verified across pages');
  });

  test('should have working theme toggle', async ({ page }) => {
    await page.goto('/dashboard');
    await page.waitForTimeout(1000);

    // Look for theme toggle button (could be various icons)
    const themeToggle = await page.locator('[data-testid="Brightness4Icon"], [data-testid="Brightness7Icon"], button[aria-label*="theme" i]').count();

    if (themeToggle > 0) {
      // Get current background color
      const initialBg = await page.evaluate(() => {
        return window.getComputedStyle(document.body).backgroundColor;
      });

      // Toggle theme
      await page.click('[data-testid="Brightness4Icon"], [data-testid="Brightness7Icon"], button[aria-label*="theme" i]');
      await page.waitForTimeout(1000);

      // Get new background color
      const newBg = await page.evaluate(() => {
        return window.getComputedStyle(document.body).backgroundColor;
      });

      console.log(`🎨 Theme toggle: Initial=${initialBg}, New=${newBg}`);
      console.log(`✅ Theme changed: ${initialBg !== newBg}`);
    } else {
      console.log('⚠️ Theme toggle button not found');
    }
  });

  test('should handle browser refresh on each page', async ({ page }) => {
    const pages = ['/dashboard', '/production', '/parts'];

    for (const pagePath of pages) {
      console.log(`🔄 Testing refresh on ${pagePath}...`);
      await page.goto(pagePath);
      await page.waitForTimeout(2000);

      // Refresh page
      await page.reload();
      await page.waitForTimeout(3000);

      // Check if page still works
      const hasContent = await page.locator('h1, h2, h3, h4').count() > 0;
      const hasErrors = await page.locator('[role="alert"]:has-text("error" i)').count() > 0;

      console.log(`   ✅ ${pagePath}: Content after refresh=${hasContent}, Errors=${hasErrors}`);

      expect(hasContent).toBeTruthy();
      expect(hasErrors).toBeFalsy();
    }
  });

  test('should test keyboard navigation', async ({ page }) => {
    await page.goto('/dashboard');
    await page.waitForTimeout(2000);

    // Test Tab navigation
    await page.keyboard.press('Tab');
    await page.waitForTimeout(500);

    // Check if focus is visible
    const focusedElement = await page.locator(':focus').count();
    console.log(`⌨️ Keyboard navigation - Focused element: ${focusedElement > 0}`);

    // Test Enter key on focused element
    if (focusedElement > 0) {
      await page.keyboard.press('Enter');
      await page.waitForTimeout(1000);
      console.log('✅ Keyboard interaction tested');
    }
  });

  test('should test error handling and 404 pages', async ({ page }) => {
    // Test invalid route
    await page.goto('/invalid-route-12345');
    await page.waitForTimeout(2000);

    const current404Url = page.url();
    console.log(`🚫 Invalid route handling: ${current404Url}`);

    // Should either redirect or show error page
    const hasErrorContent = await page.locator('text*="404", text*="not found", text*="error"').count() > 0;
    const redirectedToDashboard = current404Url.includes('/dashboard');

    console.log(`   Error page shown: ${hasErrorContent}, Redirected: ${redirectedToDashboard}`);
    expect(hasErrorContent || redirectedToDashboard).toBeTruthy();
  });

  test('should test session persistence', async ({ page }) => {
    // Login and navigate to dashboard
    await page.goto('/dashboard');
    await page.waitForTimeout(2000);

    // Close and reopen browser context (simulates app restart)
    const context = page.context();
    const newPage = await context.newPage();

    // Navigate to protected route
    await newPage.goto('/production');
    await newPage.waitForTimeout(3000);

    // Should either be logged in or redirect to login
    const currentUrl = newPage.url();
    const isLoggedIn = !currentUrl.includes('/login') && await newPage.locator('h1, h2, h3, h4').count() > 0;
    const redirectedToLogin = currentUrl.includes('/login');

    console.log(`🔒 Session persistence: URL=${currentUrl}, Logged in=${isLoggedIn}, Redirected=${redirectedToLogin}`);

    await newPage.close();
  });

  test('should test data loading states', async ({ page }) => {
    // Navigate to data-heavy pages and check for loading indicators
    const dataPages = [
      { path: '/dashboard', name: 'Dashboard' },
      { path: '/production', name: 'Production Board' },
      { path: '/parts', name: 'Parts Management' }
    ];

    for (const pageInfo of dataPages) {
      console.log(`⏳ Testing loading states for ${pageInfo.name}...`);

      // Navigate and immediately check for loading indicators
      await page.goto(pageInfo.path);

      // Check for loading indicators within first 500ms
      await page.waitForTimeout(500);
      const hasLoadingIndicator = await page.locator('.MuiCircularProgress-root, [role="progressbar"], text*="Loading"').count() > 0;

      // Wait for content to load
      await page.waitForTimeout(3000);
      const hasContent = await page.locator('h1, h2, h3, h4').count() > 0;

      console.log(`   ✅ ${pageInfo.name}: Loading indicator=${hasLoadingIndicator}, Final content=${hasContent}`);
    }
  });

  test('should test form validation across the system', async ({ page }) => {
    // Test various forms throughout the application
    const formTests = [];

    // Test customer form (if accessible)
    await page.goto('/customers');
    await page.waitForTimeout(2000);

    const addCustomerButton = await page.locator('button:has-text("Add Customer"), button:has-text("Add")').count();
    if (addCustomerButton > 0) {
      await page.click('button:has-text("Add Customer"), button:has-text("Add")');
      await page.waitForTimeout(1000);

      const dialog = await page.locator('[role="dialog"]').count();
      if (dialog > 0) {
        // Try to submit empty form
        const submitButton = await page.locator('button:has-text("Save"), button:has-text("Submit"), button[type="submit"]').count();
        if (submitButton > 0) {
