const { test, expect } = require('@playwright/test');

test.describe('Production Board Functionality', () => {
  test.beforeEach(async ({ page }) => {
    // Login and navigate to production board
    await page.goto('/');

    // Login if needed
    const needsLogin = await page.locator('input[type="password"]').count() > 0;
    if (needsLogin) {
      await page.fill('input[type="email"], input[placeholder*="admin"], input[name="username"]', 'admin');
      await page.fill('input[type="password"]', 'admin123');
      await page.click('button:has-text("Login"), button[type="submit"]');
      await page.waitForTimeout(3000);
    }

    // Navigate to production board
    await page.goto('/production');
    await page.waitForTimeout(2000);

    // Alternative navigation via menu
    const productionLink = await page.locator('a:has-text("Production"), button:has-text("Production")').count();
    if (productionLink > 0) {
      await page.click('a:has-text("Production"), button:has-text("Production")');
      await page.waitForTimeout(2000);
    }
  });

  test('should display production board title and header', async ({ page }) => {
    // Check for production board title
    await expect(page.locator('h1, h2, h3, h4').filter({ hasText: /production/i })).toBeVisible();

    // Check for subtitle/description
    const subtitle = await page.locator('text*="Manage and track job progress"').count() > 0;
    console.log(`✅ Production board header displayed, subtitle: ${subtitle}`);
  });

  test('should display kanban columns', async ({ page }) => {
    // Wait for board to load
    await page.waitForTimeout(3000);

    // Look for kanban columns based on implementation
    const columns = [
      'Estimate', 'Intake', 'Blueprint', 'Parts Ordering', 'Parts Receiving',
      'Body/Structure', 'Paint Prep', 'Paint Booth', 'Reassembly', 
      'Quality Control', 'Calibration', 'Detail', 'Ready for Pickup', 'Delivered'
    ];

    let foundColumns = 0;
    for (const columnName of columns) {
      const columnExists = await page.locator(`text="${columnName}"`).count() > 0;
      if (columnExists) foundColumns++;
    }

    console.log(`🏭 Kanban columns found: ${foundColumns}/${columns.length}`);
    expect(foundColumns).toBeGreaterThan(5); // Should find most columns
  });

  test('should display job cards in columns', async ({ page }) => {
    // Wait for data to load
    await page.waitForTimeout(3000);

    // Look for job cards
    const jobCards = await page.locator('.MuiCard-root, [role="button"]').count();
    const jobNumbers = await page.locator('text*="JOB-"').count();
    const customerNames = await page.locator('text*="John Smith", text*="Alice Johnson", text*="Bob Wilson"').count();

    console.log(`📇 Job cards found: ${jobCards}, Job numbers: ${jobNumbers}, Customer names: ${customerNames}`);
    expect(jobCards).toBeGreaterThan(0);
  });

  test('should display column capacity indicators', async ({ page }) => {
    // Look for capacity indicators (e.g., "3 / 10" in column headers)
    const capacityIndicators = await page.locator('text*="/"').count();
    const warningIcons = await page.locator('[data-testid="WarningIcon"]').count();

    console.log(`⚠️ Capacity indicators: ${capacityIndicators}, Warning icons: ${warningIcons}`);
    expect(capacityIndicators).toBeGreaterThan(0);
  });

  test('should have working search functionality', async ({ page }) => {
    // Look for search field
    const searchField = await page.locator('input[placeholder*="search" i], input[type="search"]').count();

    if (searchField > 0) {
      // Test search functionality
      await page.fill('input[placeholder*="search" i], input[type="search"]', 'JOB-001');
      await page.waitForTimeout(1000);

      // Check if results are filtered
      const searchResults = await page.locator('text*="JOB-001"').count();
      console.log(`🔍 Search results for "JOB-001": ${searchResults}`);

      // Clear search
      await page.fill('input[placeholder*="search" i], input[type="search"]', '');
      await page.waitForTimeout(500);

      console.log('✅ Search functionality tested');
    } else {
      console.log('⚠️ Search field not found');
    }
  });

  test('should have working filter controls', async ({ page }) => {
    // Look for filter button
    const filterButton = await page.locator('button:has-text("Filter"), [data-testid="FilterListIcon"]').count();

    if (filterButton > 0) {
      await page.click('button:has-text("Filter"), [data-testid="FilterListIcon"]');
      await page.waitForTimeout(1000);

      // Look for filter panel
      const filterPanel = await page.locator('[role="dialog"], .filter-panel').count();
      console.log(`🎛️ Filter panel opened: ${filterPanel > 0}`);

      // Close filter panel if opened
      if (filterPanel > 0) {
        const closeButton = await page.locator('button:has-text("Close")').count();
        if (closeButton > 0) {
          await page.click('button:has-text("Close")');
          await page.waitForTimeout(500);
        }
      }
    }

    console.log('✅ Filter controls tested');
  });

  test('should have sorting options', async ({ page }) => {
    // Look for sort dropdown
    const sortDropdown = await page.locator('select').filter({ hasText: /sort/i });
    const sortOptions = await sortDropdown.count();

    if (sortOptions > 0) {
      // Test different sort options
      await sortDropdown.selectOption('date');
      await page.waitForTimeout(1000);

      await sortDropdown.selectOption('priority');
      await page.waitForTimeout(1000);

      console.log('✅ Sorting functionality tested');
    } else {
      console.log('⚠️ Sort dropdown not found');
    }
  });

  test('should open job detail dialog when card clicked', async ({ page }) => {
    // Wait for job cards to load
    await page.waitForTimeout(3000);

    // Click on first job card
    const firstJobCard = page.locator('.MuiCard-root').first();
    const cardExists = await firstJobCard.count() > 0;

    if (cardExists) {
      await firstJobCard.click();
      await page.waitForTimeout(1000);

      // Check if dialog opened
      const dialog = await page.locator('[role="dialog"], .MuiDialog-root').count();
      console.log(`💼 Job detail dialog opened: ${dialog > 0}`);

      if (dialog > 0) {
        // Look for job details in dialog
        const jobNumber = await page.locator('text*="JOB-"').count() > 0;
        const customerInfo = await page.locator('text*="Customer"').count() > 0;

        console.log(`📋 Dialog content - Job number: ${jobNumber}, Customer info: ${customerInfo}`);

        // Close dialog
        const closeButton = await page.locator('button:has-text("Close"), button[aria-label*="close" i]').count();
        if (closeButton > 0) {
          await page.click('button:has-text("Close"), button[aria-label*="close" i]');
          await page.waitForTimeout(500);
        }
      }

      console.log('✅ Job card interaction tested');
    }
  });

  test('should have view mode toggle', async ({ page }) => {
    // Look for view mode toggle (kanban vs list)
    const viewToggle = await page.locator('[data-testid="ViewListIcon"], [data-testid="ViewModuleIcon"]').count();

    if (viewToggle > 0) {
      // Test view mode toggle
      await page.click('[data-testid="ViewListIcon"], [data-testid="ViewModuleIcon"]');
      await page.waitForTimeout(1000);

      // Toggle back
      await page.click('[data-testid="ViewListIcon"], [data-testid="ViewModuleIcon"]');
      await page.waitForTimeout(1000);

      console.log('✅ View mode toggle tested');
    } else {
      console.log('⚠️ View mode toggle not found');
