const { test, expect } = require('@playwright/test');

test('Debug click issues', async ({ page }) => {
  // Navigate to the app
  await page.goto('http://localhost:3003');

  // Wait for page to load
  await page.waitForTimeout(3000);

  // Take screenshot
  await page.screenshot({ path: 'debug-click-state.png', fullPage: true });

  console.log('📸 Screenshot taken');

  // Check what's on the page
  const title = await page.title();
  console.log(`Page title: ${title}`);

  // Find the login button
  const loginButton = page.locator('button:has-text("Login")');
  const buttonCount = await loginButton.count();
  console.log(`Login buttons found: ${buttonCount}`);

  if (buttonCount > 0) {
    // Get button properties
    const buttonBox = await loginButton.boundingBox();
    const isVisible = await loginButton.isVisible();
    const isEnabled = await loginButton.isEnabled();

    console.log(`Button visible: ${isVisible}`);
    console.log(`Button enabled: ${isEnabled}`);
    console.log(`Button box:`, buttonBox);

    // Check what element is at the button's position
    if (buttonBox) {
      const elementAtCenter = await page.locator(`xpath=//*[position()=${buttonBox.x + buttonBox.width/2}, ${buttonBox.y + buttonBox.height/2}]`).first();
      const centerElement = await page.evaluate((coords) => {
        return document.elementFromPoint(coords.x, coords.y);
      }, { x: buttonBox.x + buttonBox.width/2, y: buttonBox.y + buttonBox.height/2 });

      console.log('Element at button center:', centerElement);
    }

    // Try different click methods
    console.log('\n🖱️ Testing click methods...');

    // Method 1: Regular click
    try {
      await loginButton.click({ timeout: 5000 });
      console.log('✅ Regular click worked');
    } catch (error) {
      console.log('❌ Regular click failed:', error.message.substring(0, 100));
    }

    // Method 2: Force click
    try {
      await loginButton.click({ force: true, timeout: 5000 });
      console.log('✅ Force click worked');
    } catch (error) {
      console.log('❌ Force click failed:', error.message.substring(0, 100));
    }

    // Method 3: Click by coordinates
    if (buttonBox) {
      try {
        await page.mouse.click(buttonBox.x + buttonBox.width/2, buttonBox.y + buttonBox.height/2);
        console.log('✅ Coordinate click worked');
      } catch (error) {
        console.log('❌ Coordinate click failed:', error.message.substring(0, 100));
      }
    }
  }

  // Check CSS properties that might block clicks
  const bodyStyle = await page.evaluate(() => {
    const body = document.body;
    const style = window.getComputedStyle(body);
    return {
      pointerEvents: style.pointerEvents,
      userSelect: style.userSelect,
      position: style.position,
      zIndex: style.zIndex
    };
  });

  console.log('\n🎨 Body CSS properties:', bodyStyle);

  // Check root element
  const rootStyle = await page.evaluate(() => {
    const root = document.getElementById('root');
    if (root) {
      const style = window.getComputedStyle(root);
      return {
        pointerEvents: style.pointerEvents,
        userSelect: style.userSelect,
        position: style.position,
        zIndex: style.zIndex,
        overflow: style.overflow
      };
    }
    return null;
  });

  console.log('🌳 Root element CSS:', rootStyle);

  // List all elements with pointer-events: none
  const blockedElements = await page.evaluate(() => {
    const all = document.querySelectorAll('*');
    const blocked = [];
    for (let el of all) {
      const style = window.getComputedStyle(el);
      if (style.pointerEvents === 'none' && el.offsetParent !== null) {
        blocked.push({
          tag: el.tagName,
          class: el.className,
          id: el.id,
          pointerEvents: style.pointerEvents
        });
      }
    }
    return blocked.slice(0, 10); // Limit to first 10
  });

  console.log('\n🚫 Elements with pointer-events: none:', blockedElements);
});

