const { test, expect } = require('@playwright/test');

test('Final click functionality test', async ({ page }) => {
  // Navigate to the app
  await page.goto('/');

  // Wait for page to load completely
  await page.waitForLoadState('networkidle');
  await page.waitForTimeout(2000);

  console.log('🔍 Testing all click methods on login button...');

  // Fill out the login form first
  await page.fill('input[placeholder="admin"]', 'admin');
  await page.fill('input[type="password"]', 'admin123');

  const loginButton = page.locator('button:has-text("Login")');

  // Test 1: Regular click (most important for user experience)
  try {
    console.log('🖱️ Trying regular click...');
    await loginButton.click({ timeout: 10000 });

    // Wait for navigation or response
    await page.waitForTimeout(3000);

    // Check if login was successful
    const currentUrl = page.url();
    console.log(`Current URL after click: ${currentUrl}`);

    if (currentUrl.includes('dashboard') || currentUrl !== 'http://localhost:3003/') {
      console.log('✅ SUCCESS: Regular click works! Login successful.');
      expect(true).toBe(true);
      return;
    } else {
      console.log('⚠️ Click registered but no navigation occurred');
    }
  } catch (error) {
    console.log('❌ Regular click failed:', error.message.substring(0, 100));

    // Test 2: Try Enter key as fallback
    try {
      console.log('⌨️ Trying Enter key fallback...');
      // Refresh and try again
      await page.goto('/');
      await page.waitForTimeout(2000);
      await page.fill('input[placeholder="admin"]', 'admin');
      await page.fill('input[type="password"]', 'admin123');
      await page.press('input[type="password"]', 'Enter');
      await page.waitForTimeout(3000);

      const urlAfterEnter = page.url();
      console.log(`URL after Enter key: ${urlAfterEnter}`);

      if (urlAfterEnter.includes('dashboard')) {
        console.log('✅ SUCCESS: Enter key works as fallback!');
        expect(true).toBe(true);
        return;
      }
    } catch (enterError) {
      console.log('❌ Enter key also failed:', enterError.message.substring(0, 100));
    }

    // Test 3: Force click as last resort
    try {
      console.log('💪 Trying force click as last resort...');
      await page.goto('/');
      await page.waitForTimeout(2000);
      await page.fill('input[placeholder="admin"]', 'admin');
      await page.fill('input[type="password"]', 'admin123');
      await loginButton.click({ force: true });
      await page.waitForTimeout(3000);

      const urlAfterForce = page.url();
      console.log(`URL after force click: ${urlAfterForce}`);

      if (urlAfterForce.includes('dashboard')) {
        console.log('✅ SUCCESS: Force click works!');
        expect(true).toBe(true);
        return;
      }
    } catch (forceError) {
      console.log('❌ Force click also failed:', forceError.message.substring(0, 100));
    }

    console.log('❌ FAILURE: No click method worked');
    expect(false).toBe(true); // Fail the test
  }
});

